import React from 'react';
import './Home.css';
function Home() {
  const featuredProducts = [
    {
      id: 1,
      name: "Running Shoes",
      price: 99.99,
      image: "/images/sports1.png"
    },
    {
      id: 2,
      name: "Casual Sneakers",
      price: 79.99,
      image: "/images/casual1.jpg"
    },
    // Add more products
  ];

  return (
    <div className="home">
      <section className="hero">
        <div className="hero-content">
          <h1>Welcome to SHOE STOR</h1>
          <p>Discover the latest trends in footwear</p>
          <button className="cta-button">Shop Now</button>
        </div>
      </section>

      <section className="categories-section">
        <h2>Shop by Category</h2>
        <div className="category-grid">
          <div className="category-card">Sports</div>
          <div className="category-card">Casual</div>
          <div className="category-card">Formal</div>
          <div className="category-card">Kids</div>
        </div>
      </section>

      <section className="featured-section">
        <h2>Featured Products</h2>
        <div className="product-grid">
          {featuredProducts.map(product => (
            <div key={product.id} className="product-card">
              <img src={product.image} alt={product.name} />
              <h3>{product.name}</h3>
              <p className="price">${product.price}</p>
              <button className="add-to-cart">Add to Cart</button>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
}

export default Home;
